// SupportsTagging returns whether an AWS resource type supports the tags attribute
func SupportsTagging(resourceType string) bool {
	supported, exists := AWSResourceTaggingSupport[resourceType]
	return exists && supported
}

// GetServiceName extracts the AWS service name from a resource type
func GetServiceName(resourceType string) string {
	if service, exists := AWSResourceToService[resourceType]; exists {
		return service
	}
	// Fallback extraction
	if strings.HasPrefix(resourceType, "aws_") {
		parts := strings.Split(resourceType[4:], "_")
		if len(parts) > 0 {
			return parts[0]
		}
	}
	return "unknown"
}

// GetResourceCategory returns the category of a resource based on its tagging support
func GetResourceCategory(resourceType string) string {
	if SupportsTagging(resourceType) {
		return "taggable"
	}
	
	// Categorize non-taggable resources
	if strings.Contains(resourceType, "_attachment") ||
		strings.Contains(resourceType, "_association") ||
		strings.Contains(resourceType, "_permission") {
		return "association"
	}
	
	if strings.Contains(resourceType, "_validation") ||
		strings.Contains(resourceType, "_certificate") {
		return "validation"
	}
	
	if strings.Contains(resourceType, "_deployment") ||
		strings.Contains(resourceType, "_method") ||
		strings.Contains(resourceType, "_integration") {
		return "configuration"
	}
	
	return "non-taggable"
}

// GetTaggingReason provides a human-readable reason for tagging support status
func GetTaggingReason(resourceType string) string {
	if SupportsTagging(resourceType) {
		return "Resource supports the 'tags' attribute"
	}
	
	category := GetResourceCategory(resourceType)
	switch category {
	case "association":
		return "Association/attachment resources typically don't support tags"
	case "validation":
		return "Validation/certificate resources typically don't support tags"
	case "configuration":
		return "Configuration/deployment resources typically don't support tags"
	default:
		return "Resource does not support the 'tags' attribute in AWS provider"
	}
}
